Expo SDK 54 uses the community AsyncStorage package. The 2026 docs flow is still:

1) Install
```bash
npx expo install @react-native-async-storage/async-storage
```

2) Import and use
```ts
import AsyncStorage from '@react-native-async-storage/async-storage';

export async function saveUser(user: { id: string; name: string }) {
  await AsyncStorage.setItem('user', JSON.stringify(user));
}

export async function loadUser() {
  const raw = await AsyncStorage.getItem('user');
  return raw ? JSON.parse(raw) : null;
}

export async function removeUser() {
  await AsyncStorage.removeItem('user');
}
```

Notes:
- Values are strings only; serialize objects with `JSON.stringify`.
- All APIs are async and return Promises.
- Prefer namespaced keys like `@myapp:user` to avoid collisions.

